    def gcd(a, b):
        while b:
            (a, b) = (b, a % b)
        return a

    def lcm(a, b):
        return a * b // gcd(a, b)
    operations.sort(key=lambda x: x[0], reverse=True)
    ans = 1
    running_lcm = 1
    empty_spots = n
    for (x, y) in operations:
        running_lcm = lcm(running_lcm, y)
        ans += (empty_spots - n // running_lcm) * x
        empty_spots -= empty_spots - n // running_lcm
        if not empty_spots:
            break
    return ans

